import { BrowserRouter } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Pagina from './routes/index';
import { NavMenuModule } from './components/NavBar';

const App = ()=>{
    return (
        <BrowserRouter>
            <NavMenuModule/>
            <Pagina/>
        </BrowserRouter>
    );
};

export default App;
